import React, { useState } from 'react'
import { Link } from 'react-router-dom';
const Login = () => {
const [user, setUser] = useState({
    email: "",
    password: ""
})
const inputVal = (e) => {
    const {name, value} = e.target;
    setUser({
        ...user,
        [name]: value
    })
}
    return (
        <>
            {/* onChange={(e)=>{setUser({...user, f_name: e.target.value})}} */}
            <div className="register">
                 <h1>Login</h1>
                <input type="text" value={user.email} placeholder="Email Address" name="email" onChange={inputVal} />
                <input type="password" value={user.password} placeholder="Password" name="password" onChange={inputVal} />
                <div className="button">Login</div>
                <div>OR</div>
                <div className="button"><Link to="/register">Register</Link></div>
            </div>
        </>
    )
}
export default Login;
